import Link from 'next/link';


const Navbar = () => (
<div>
    <div className="container">
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/about">
            <a>About</a>
        </Link>
    </div>   
    <style jsx>{`
        a {
            color: red;
        }

        .container {
            display: flex;
            padding: 50vw;
        }
    `} </style>
</div>

);
  
  export default Navbar;
